import { MenuList } from "../helpers/MenuList";
import React from "react";
import MenuItem from "../components/MenuItem";

function Menu() {
  return (
    <div className="menu">
      <h1>What do you wanna have?</h1>
      <div className="menuList">
        {MenuList.map((menuItem, key) => {
          return <MenuItem></MenuItem>;
        })}
      </div>
    </div>
  );
}

export default Menu;
